range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1317447","type":"CustomJS"},{"attributes":{"coordinates":null,"data_source":{"id":"1317293"},"glyph":{"id":"1317425"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1317427"},"nonselection_glyph":{"id":"1317426"},"view":{"id":"1317429"}},"id":"1317428","type":"GlyphRenderer"},{"attributes":{"source":{"id":"1317293"}},"id":"1317339","type":"CDSView"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","line_width":1.3,"x":{"field":"index"},"y":{"field":"ebsw(C)_0_1"}},"id":"1317426","type":"Line"},{"attributes":{"data":{"Close":{"__ndarray__":"exSuR+E6O0BI4XoUrsc7QHsUrkfhujtAw/UoXI9CPUB7FK5H4Xo+QFK4HoXrkT1ArkfhehQuPECF61G4HgU9QI/C9ShcjztAKVyPwvUoO0AfhetRuJ49QMP1KFyPgj1AAAAAAADAP0BSuB6F65E/QAAAAAAAwEBA16NwPQr3QUBSuB6F63FCQEjhehSuB0JA16NwPQrXQkAfhetRuN5CQD0K16NwvUNAMzMzMzNzRkDheh
